abstract class Countable{
   protected String name;
   protected int num;

   Countable(String name,int num){
      this.name = name;
      this.num = num;
   }

   abstract void count();
}

class Bird extends Countable{

   Bird(String name,int num) {
      super(name,num);
      this.name = name;
      this.num = num;
   }

   void fly() {
      System.out.println(this.num+"마리 "+this.name+"가 날아간다.");
   }

   void count() {
      System.out.println(this.name+"가 "+this.num+"마리 있다.");
   }

}


class Tree extends Countable{

   Tree(String name,int num) {
      super(name, num);
      this.name = name;
      this.num = num;
   }

   void ripen() {
      System.out.println(this.num+"그루 "+this.name+"에 열매가 잘 익었다.");
   }

   void count() {
      System.out.println(this.name+"가 "+this.num+"그루 있다.");
   }
}

public class Lab7_1 {

   public static void main(String[] args) {
      Countable[] m = {new Bird("뻐꾸기",5),new Bird("독수리",2),new Tree("사과나무",10),new Tree("밤나무",7)};

      for (Countable e : m) {
         e.count();
      }

      for (int i=0; i<m.length;i++) {
         if(m[i] instanceof Bird) {
            ((Bird) m[i]).fly();
         }
         if(m[i] instanceof Tree) {
            ((Tree) m[i]).ripen();
         }
      }      
   }
}

public class Lab8_2 {

	interface Controllable {

		public default void repair() {
			System.out.println("서비스 센터에서 수리해야한다.");
		}

		public static void reset() {
			System.out.println("내가 초기화 할 수 있다.");
		}

		public void power(String tv, boolean onOff);
	}

	public static void main(String[] args) {

		String who = "나는";

		class TV implements Controllable {

			public void power(String tv, boolean onOff) {
				if (onOff) {
					System.out.printf("%s가 %s를 켠다.\n", who, tv);
				} else {
					System.out.printf("%s가 %s를 끈다.\n", who, tv);
				}
			}
		}

		Controllable tv = new TV();
		tv.power("TV", true);
		tv.power("TV", false);
		tv.repair();
		Controllable.reset();
	}
}

