#include <iostream>
#include <cstdlib>

using namespace std;

#define MaxSize 7

int hash(int num) { return num % MaxSize; }

class Node
{
private:
    int data;
    Node *link;
    Node(int value)
    {
        data = value;
        link = 0;
    }
    friend class Htable;
};

class Htable
{
private:
    Node *head;

public:
    Htable() { head = 0; }
    int findKey(int);
    void insertKey(int);
    void deleteKey(int);
    void printable(int);
};

int Htable::findKey(int data)
{
    Node *p;

    if (head != 0)
    {
        p = head;
        while (p != 0 && p->data != data)
        {
            p = p->link;
        }
        if (p)
            cout << p->data << " is Found" << endl;
        else
            cout << data << " is not in the list." << endl;
    }
    else
        cout << "List is Empty" << endl;
}

void Htable::insertKey(int data)
{
    Node *temp = new Node(data);
    Node *p, *q;

    if (head == 0)
        head = temp;
    else
    {
        p = head;
        while ((p != 0))
        {
            q = p;
            p = p->link;
        }
        if (p != 0)
        {
            temp->link = p;
            q->link = temp;
        }
        else
        {
            q->link = temp;
        }
    }
}

void Htable::deleteKey(int data)
{
    Node *p, *q;
    if (head->data == data)
    {
        p = head;
        head = head->link;
        delete p;
    }
    else
    {
        p = head;
        while (p != 0 && p->data != data && p->link != 0)
        {
            q = p;
            p = p->link;
        }
        if (p != 0)
        {
            q->link = p->link;
        }
        else
        {
            cout << data << " is not in the list" << endl;
        }
    }
}

void Htable::printable(int i)
{
    Node *p;
    cout << "HTable [" << i << "]: ";
    p = head;
    while ((p != 0))
    {
        cout << p->data << "-> ";
        p = p->link;
    }
    cout << endl;
}


